import * as React from "react";
import styled from "styled-components";
const Home: React.FC = () => {
  return (
    <Container>
      <Header>커뮤니티</Header>
      <div>1111</div>
    </Container>
  );
};

export default Home;

const Container = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  border: solid grey 1px;
  border-radius: 15px;
`;
const Header = styled.header`
  width: 81px;
  line-height: 32px;
  height: 32px;
  top: 34px;
  left: 30px;
  font-weight: 700;
  font-size: 22px;
`;
